	bool GIFCapture::Init(bool isWeb, int sedVersion) {
		m_recording = false;
		m_fps = 25;
		m_frame = nullptr;
		m_frameFlipped = nullptr;
		m_showProperties = false;

		m_width = 1920;
		m_height = 1080;
		m_useLogo = true;

		m_outputPath[0] = 0;
		strcpy(m_outputPath, "capture.gif");

		RegisterShortcut(this, "GIFCapture.StartStop");

		return 0;
	}
	void GIFCapture::InitUI(void* ctx) {
		ImGui::SetCurrentContext((ImGuiContext*)ctx);
	}
	bool GIFCapture::HasCustomMenuItem() {
		return true;
	}
	bool GIFCapture::HasMenuItems(const char* name) {
		return false;
	}
	void GIFCapture::ShowMenuItems(const char* name) {
		if (strcmp(name, "custom") == 0) {
			if (!m_recording) {
				if (ImGui::MenuItem("Record"))
					m_startStop();
				if (ImGui::MenuItem("Properties")) {
					m_showProperties = true;
				}
			} else {
				if (ImGui::MenuItem("Stop"))
					m_startStop();
			}
		}
	}


	void GIFCapture::m_renderProperties()
	{
		ImGui::Text("FPS: 25");

		ImGui::Text("Show logo ");
		ImGui::SameLine();
		ImGui::Checkbox("##gifc_logo", &m_useLogo);

		ImGui::Text("Output path: %s", m_outputPath);
		ImGui::SameLine();
		if (ImGui::Button("...")) {
			char filePtr[512] = { 0 };
			if (GetSaveFileDialog(filePtr, nullptr))
				strcpy(m_outputPath, filePtr);			
		}

		ImGui::Text("Width ");
		ImGui::SameLine();
		if (ImGui::InputInt("##gifc_width", &m_width))
			if (m_width < 128) m_width = 128;

		ImGui::Text("Height ");
		ImGui::SameLine();
		if (ImGui::InputInt("##gifc_height", &m_height))
			if (m_height < 128) m_height = 128;
	}
	bool GIFCapture::Options_HasSection()
	{
		return true;
	}
	void GIFCapture::Options_RenderSection()
	{
		m_renderProperties();
	}
	void GIFCapture::Options_Parse(const char* key, const char* val)
	{
		if (strcmp(key, "show_logo") == 0)
			m_useLogo = std::stoi(val);
		else if (strcmp(key, "out_path") == 0)
			strcpy(m_outputPath, val);
		else if (strcmp(key, "gif_width") == 0) {
			m_width = std::stoi(val);
			if (m_width < 128) m_width = 128;
		}
		else if (strcmp(key, "gif_height") == 0) {
			m_height = std::stoi(val);
			if (m_height < 128) m_height = 128;
		}
	}
	int GIFCapture::Options_GetCount()
	{
		return 4;
	}
	const char* GIFCapture::Options_GetKey(int index)
	{
		switch (index) {
		case 0: return "show_logo"; break;
		case 1: return "out_path"; break;
		case 2: return "gif_width"; break;
		case 3: return "gif_height"; break;
		}
	}
	const char* GIFCapture::Options_GetValue(int index)
	{
		switch (index) {
		case 0: m_tempProp = std::to_string(m_useLogo); break;
		case 1: return m_outputPath; break;
		case 2: m_tempProp = std::to_string(m_width); break;
		case 3: m_tempProp = std::to_string(m_height); break;
		}
		return m_tempProp.c_str();
	}

	void GIFCapture::m_flipFrame()
	{
		for (int y = 0; y < m_height; y++)
			memcpy(m_frameFlipped + y * m_width * 4, m_frame + (m_height - y - 1) * m_width * 4, m_width * 4 * sizeof(uint8_t));
	}
	void GIFCapture::Update(float delta)
	{
		if (m_recording) {
			float curTime = GetTime();
			if (curTime - m_lastFrameCapture > m_waitMS) {
				Render(Renderer, m_width, m_height);
				
				SetTime(m_lastFrameCapture + m_waitMS);

				GLuint rtID = GetWindowColorTexture(Renderer);
				glBindTexture(GL_TEXTURE_2D, rtID);
				glGetTexImage(GL_TEXTURE_2D, 0, GL_RGBA, GL_UNSIGNED_BYTE, m_frame);
				glBindTexture(GL_TEXTURE_2D, 0);

				m_flipFrame();
				m_blitLogo();

				GifWriteFrame(&m_gif, m_frameFlipped, m_width, m_height, 100 / m_fps);

				m_frameIndex++;
				m_lastFrameCapture = m_timeCaptureStarted + m_frameIndex * m_waitMS;

				SetTime(curTime);
			}

			float uiRect[4];
			GetPreviewUIRect(UI, uiRect);

			ImGui::SetNextWindowPos(ImVec2(uiRect[0] + 15.0f, uiRect[1] + 15.0f), ImGuiCond_Always);
			ImGui::SetNextWindowBgAlpha(0.4f);
			if (ImGui::Begin("##gifcap_curtime", 0, ImGuiWindowFlags_NoDecoration | ImGuiWindowFlags_NoDocking | ImGuiWindowFlags_AlwaysAutoResize | ImGuiWindowFlags_NoSavedSettings | ImGuiWindowFlags_NoFocusOnAppearing | ImGuiWindowFlags_NoNav | ImGuiWindowFlags_NoMove))
			{
				float dur = m_frameIndex * m_waitMS;
				int gifMS = (int)(dur * 1000) % 1000;
				int gifMin = (int)(dur / 60);
				int gifSec = (int)(dur - gifMin * 60.0f);
				ImGui::Text("%02d:%02d:%03d\n", gifMin, gifSec, gifMS);
			}
			ImGui::End();
		}

		if (m_showProperties) {
			ImGui::OpenPopup("GIF capture properties##gifc_props");
			m_showProperties = false;
		}

		if (ImGui::BeginPopupModal("GIF capture properties##gifc_props")) {
			m_renderProperties();
			if (ImGui::Button("OK"))
				ImGui::CloseCurrentPopup();
			ImGui::EndPopup();
		}
	}

	void GIFCapture::HandleShortcut(const char* name)
	{
		if (strcmp(name, "GIFCapture.StartStop") == 0)
			m_startStop();
	}

